define("3rdlibs/angular/docs/examples/example-number-input-directive/protractor",["dojo","dijit","dojox"],function(e,t,i){var n=element(by.binding("example.value")),o=element(by.binding("myForm.input.$valid")),l=element(by.model("example.value"));it("should initialize to model",function(){expect(n.getText()).toContain("12"),expect(o.getText()).toContain("true")}),it("should be invalid if empty",function(){l.clear(),l.sendKeys(""),expect(n.getText()).toEqual("value ="),expect(o.getText()).toContain("false")}),it("should be invalid if over max",function(){l.clear(),l.sendKeys("123"),expect(n.getText()).toEqual("value ="),expect(o.getText()).toContain("false")})});